import galleryImg03 from './image/beaches.webp';
import galleryImg04 from './image/crafts.webp';
import galleryImg05 from './image/cuisine.webp';
import galleryImg06 from './image/festivals.webp';
import galleryImg07 from './image/festivals.webp';


